fd47c4a360dd037c11569d9ff51e0bbd258b2adc:
query GetAllVehicles {
  vehicles(first: 25, orderBy: blockTimestamp, orderDirection: desc) {
    id
    partner
    vin
    make
    model
    year
    blockNumber
    blockTimestamp
    transactionHash
  }
}

bdd8a61857887fd8aa8ac42d04f01d13c5437f6c:
query GetVehicles($partner: Bytes) {
  vehicles(
    first: 25
    orderBy: blockTimestamp
    orderDirection: desc
    where: {partner: $partner}
  ) {
    id
    partner
    vin
    make
    model
    year
    blockNumber
    blockTimestamp
    transactionHash
  }
}
